package com.bms.model;

public class ReserveTableModel {
	private Integer reserveId;
	private Integer userId;
	private Integer diningTableId;
	private String reserveDate;
	private String reserveTime;
	private String phonenum;
	private String linkman;
	private String state;
	public ReserveTableModel() {
		super();
		// TODO Auto-generated constructor stub
	}
	public ReserveTableModel(Integer reserveId, Integer userId, Integer diningTableId, String reserveDate,
			String reserveTime, String phonenum, String linkman, String state) {
		super();
		this.reserveId = reserveId;
		this.userId = userId;
		this.diningTableId = diningTableId;
		this.reserveDate = reserveDate;
		this.reserveTime = reserveTime;
		this.phonenum = phonenum;
		this.linkman = linkman;
		this.state = state;
	}
	public Integer getReserveId() {
		return reserveId;
	}
	public void setReserveId(Integer reserveId) {
		this.reserveId = reserveId;
	}
	public Integer getUserId() {
		return userId;
	}
	public void setUserId(Integer userId) {
		this.userId = userId;
	}
	public Integer getDiningTableId() {
		return diningTableId;
	}
	public void setDiningTableId(Integer diningTableId) {
		this.diningTableId = diningTableId;
	}
	public String getReserveDate() {
		return reserveDate;
	}
	public void setReserveDate(String reserveDate) {
		this.reserveDate = reserveDate;
	}
	public String getReserveTime() {
		return reserveTime;
	}
	public void setReserveTime(String reserveTime) {
		this.reserveTime = reserveTime;
	}
	public String getPhonenum() {
		return phonenum;
	}
	public void setPhonenum(String phonenum) {
		this.phonenum = phonenum;
	}
	public String getLinkman() {
		return linkman;
	}
	public void setLinkman(String linkman) {
		this.linkman = linkman;
	}
	public String getState() {
		return state;
	}
	public void setState(String state) {
		this.state = state;
	}
	@Override
	public String toString() {
		return "ReserveTableModel [reserveId=" + reserveId + ", userId=" + userId + ", diningTableId=" + diningTableId
				+ ", reserveDate=" + reserveDate + ", reserveTime=" + reserveTime + ", phonenum=" + phonenum
				+ ", linkman=" + linkman + ", state=" + state + "]";
	}

}
